import React, { Component } from 'react';

export class Registration extends Component {
    constructor(props){
        super(props);
        this.state = {
            username:"",
            password:"",
            password_confirmation:"",
            registration_errors:""
        }
        this.handleChange=this.handleChange.bind(this)
        this.handleSubmit=this.handleSubmit.bind(this)
    }
    handleChange(event){
        this.setState(
            [event.target.name]
        )
    }
    handleSubmit(event){
        console.log("form submitted");
        event.preventDefault();
    }

    render() {
        return (
            <div>
                <form onSubmit = {this.handleSubmit}>
                    <input type="text" placeholder="username" value={this.state.username} onChange = {this.handleChange} required></input>
                    <input type="password" placeholder="password" value={this.state.password} onChange={this.handleChange} required></input>
                    <input type="password" placeholder="password confirm" value={this.state.password_confirmation} onChange={this.handleChange} required></input>
                    <input type="submit" name="" id="" class="btn btn-primary" value="Register"></input>
                </form>
            </div>
        );
    }
}

export default Registration;
